import React, {useEffect, useState} from 'react'
import "../CSS/main.css";
import Header from './Header';
import { useNavigate } from 'react-router-dom';

function Main() {
  const navigate = useNavigate();
  const [elderData, setElderData] = useState([{}])
  const sessionData = sessionStorage.getItem("UserSession");
  useEffect(()=>{
    
    var userId = JSON.parse(sessionData)
   

      console.log(userId["user_id"]);
      fetch(`/api/caregivers/${userId["user_id"]}/elder-list`)
      .then(response => response.json())
      .then(elders => {
        setElderData(elders);
        console.log(elderData); // Do something with the retrieved car list
      })
      .catch(error => console.error(error));
    
    
  }, [])
  
  const handleMonitor = (event) => {
    const data = event.target.value.split('+');
    navigate.push({
      pathname: '/monitor',
      state: { name: data[0], sirname: data[1], address: data[2] },
    });
  };

  const ElderDetails = ({ name, sirname, address }) => {
    return (
      <div className="elder-details">
        <h2>{name} {sirname}</h2>
        <button className='button-list' value={`${name}+${sirname}+${address}`} onClick={handleMonitor}> Monitor  </button>
        <h3>{address}</h3>
        <h3>Location</h3>
        <div className="elder-configuration">
        <button>Red</button>
        <button>Del</button>
        </div>
      </div>
    );
  };

  return (
    <div className="main-background">
    <Header />
      <div>
        {elderData.map((person, index) => (
          <ElderDetails
            key={index}
            name={person.name}
            sirname={person.sirname}
            address={person.address}
          />
        ))}
      </div>
    </div>

  )
}

export default Main
